import{_ as o,c as t,o as a,k as e}from"./chunks/framework.bbhau2DI.js";const B=JSON.parse('{"title":"Backing Up Your BIOS","description":"Backup first before upgrading Bios","frontmatter":{"title":"Backing Up Your BIOS","description":"Backup first before upgrading Bios","date":"2024-03-18T00:00:00.000Z","tags":["Personal Computer","Advice"]},"headers":[],"relativePath":"posts/08.md","filePath":"posts/08.md"}'),s={name:"posts/08.md"},r=e("p",null,"Before updating a BIOS, it is generally a good idea to see if it is possible to save a backup copy of theexisting BIOS. The reason is that certain motherboard manufacturers only provide the most recent BIOS for a specific model of Motherboards and sometimes a newer BIOS may cause problems or have consequences you are not ready to live with. By having a backup you will be able to go back to the previous version. To make the backup, run the BIOS upgrade program for your board, and check to see if there is an option to save the existing BIOS to a file. If that option is not available, check to see if your motherboard manu- facturer offers older versions (including the one you have) for download.",-1),n=e("p",null,"If there is no menu option to back up and no older versions can be downloaded, there may be other ways to make a copy of the BIOS, such as by using the DOS commandâ€“based BIOS upgrade software usually found on the BIOS CD of the motherboard.",-1),i=[r,n];function c(d,p,u,h,l,f){return a(),t("div",null,i)}const b=o(s,[["render",c]]);export{B as __pageData,b as default};
